schemaDefinition: "create or replace view X_SNC_ACCEL_DOWNLOAD_HISTORY(\n\t\"DownloadHistorySysID\"\
  ,\n\t\"DownloadHistoryNowCreatorsErrorMsg\",\n\t\"DownloadHistoryNowCreatorsSyncStatus\"\
  ,\n\t\"DownloadHistoryTableName\",\n\t\"DownloadHistoryDocumentID\",\n\t\"DownloadHistoryname\"\
  ,\n\t\"DownloadHistoryUser\",\n\t\"DownloadHistoryUserRecord\",\n\t\"DownloadHistorySysCreatedOn\"\
  ,\n\t\"DownloadHistoryPSPPerUpdateDate\"\n) as -- SEMANTIC LAYER BEGINS\n\nSELECT\
  \ \"SYS_ID\" as \"DownloadHistorySysID\",\n       \"NOW_CREATORS_ERROR_MSG\" as\
  \ \"DownloadHistoryNowCreatorsErrorMsg\",\n       \"NOW_CREATORS_SYNC_STATUS\" as\
  \ \"DownloadHistoryNowCreatorsSyncStatus\",\n       \"TABLE_NAME\" as \"DownloadHistoryTableName\"\
  ,\n       \"DOCUMENT_ID\" as \"DownloadHistoryDocumentID\",\n       \"NAME\" as\
  \ \"DownloadHistoryname\",\n       \"USER\" as \"DownloadHistoryUser\",\n      \
  \ \"USER_RECORD\" as \"DownloadHistoryUserRecord\",\n       \"SYS_CREATED_ON\" as\
  \ \"DownloadHistorySysCreatedOn\",\n       \"PSP_PER_UPDATE_DT\" as \"DownloadHistoryPSPPerUpdateDate\"\
  \nFROM \"RDS\".\"LXP\".\"X_SNC_ACCEL_DOWNLOAD_HISTORY\";"
